  "cont_step1_section_descriptions": "사진을 업로드하고 서비스를 이용하시는 경우, 개인정보 수집 및 이용에 동의하는 것으로 간주합니다. 거부하실 수 있으나 거부하시는 경우 AI 이미지 생성 서비스를 이용하실 수 없습니다.\nAI 이미지는 본인 증명 용으로 사용하실 수 없습니다. (주민등록증, 운전면허증, 여권 등)\n타인의 사진을 사용하여 AI 이미지를 생성하는 것은 플레이소나 이용 약관에 위배될 수 있으며, 사용자 본인의 사진만을 사용하여 AI 이미지를 생성하는 것 만을 회사는 보장합니다.\nPlaysona의 AI는 적은 사진으로도 얼굴을 잘 학습할 수 있도록 계속해서 개선 중이며, AI가 제작하는 일부 사진의 결과물이 만족스럽지 못할 수 있습니다. 반드시 위의 얼굴 사진 등록 가이드를 확인하신 후 적합한 사진을 추가해 주세요.\nAI 이미지는 AI 프로그램에 의해 사용자가 등록하는 1장의 얼굴사진을 바탕으로 사용자의 얼굴 특징을 학습하여 임의의 결과가 생성 되므로, 회사는 생성된 사진의 품질을 보증할 수 없습니다. 이를 이유로 한 환불은 불가능합니다.\n포인트 상품의 경우, 사용자의 포인트 결제 여부를 확인 후 즉시 사용되므로, 사진 생성이 시작되면 전자상거래법 시행령 제 21조 (‘소비자의 주문에 따라 개별적으로 생산되는 재화)에 따라 청약철회 및 해제가 불가합니다.\n단, 구매한 상품이 회사가 표시, 광고한 내용과 다르거나 계약 내용과 다르게 이행된 경우에는 구매한 날부터 3개월 이내, 그 사실을 알게 된 날 또는 알 수 있었던 날로부터 30일 이내 청약철회 및 해제를 할 수 있습니다. 이러한 경우 영업일 5일 이내 회사는 사용자가 지불한 포인트를 계정으로 즉시 반환해야 합니다.\nAI 이미지 생성 서비스는 회사의 사정에 따라 사전 고지 없이 내용이 변경되거나 운영이 중단될 수 있습니다.",
