  "store_notice_section_descriptions": "인 앱 결제로 결제한 포인트의 결제 취소는 스토어 내 고객센터에 직접 문의하시거나 자주하는 질문 메뉴 내 문의하기를 통해서 메일 주세요.\n충전된 포인트의 유효기간은 충전 후 1년이며, 이벤트 등으로 무료로 지급된 티켓의 유효기간은 이벤트마다 기간이 달라질 수 있습니다. 유효기간 내 모두 소진하지 않으면 소멸됩니다.\n포인트 사용 시, 유효기간에 따라 우선순위로 사용하게 되며, 사용한 이후에는 환불할 수 없습니다.\n포인트 및 티켓을 부정하게 환불받은 경우를 확인한 후, 회사는 보유한 포인트 및 티켓을 강제 회수 할 수 있습니다.\n미성년자가 유료서비스를 이용하는 경우, 법정대리인이 동의하지 않으면 미성년자 본인 또는 법정대리인이 이용계약을 취소할 수 있습니다.\n결제 및 포인트 사용 관련 내용은 이용약관에서 더 자세히 확인 할 수 있으며, 기타 문의 사항 및 궁금하신 점은 자주하는 질문 또는 문의하기를 통해서도 확인하실 수 있습니다.",
